import React from 'react'
import { useState, useEffect } from 'react';

export const FetchApiData = () => {

    const[user,setUser]=useState([])
    const getData=async()=>{
        const response=await fetch('https://jsonplaceholder.typicode.com/users');
        // const data=await response.json();
        // console.log(data);
        setUser(await response.json());
    }
    useEffect(()=>{
        getData();
    },[])

  return (
    <div>
        <div className='container'>
    <div className='row'>
            {
                user.map((CurrentData)=>{
                    return(
        <div className='col-md-4' key={CurrentData.id}>
            <div className="card cardd" >
            <p> Name is : {CurrentData.name}</p>
            <div className="card-body">
            <h2 className="card-title">Email : {CurrentData.email}</h2>
            <p className="card-text"> Username : {CurrentData.username}</p>
            <p> PH : {CurrentData.phone}</p>
            <h5 className="card-title">Website : {CurrentData.website}</h5>
            <p>Company: {CurrentData.company.name.catchPhrase}</p>
            <div className="card cardd">
                 <p><h2>Address:</h2>
                    Street: {CurrentData.address.street},
                    Suite: {CurrentData.address.suite},
                    City: {CurrentData.address.city},
                    Zipcode: {CurrentData.address.zipcode}</p>
            </div>
            <div className="card cardd">
                <p>Geo: {CurrentData.geo}</p>
            </div>
            <a href="#" className="btn btn-primary">Go somewhere</a>
            </div>
            </div>
        </div> 
                    )
                })
            }
    </div>
</div>

    </div>
  )
}
